import "./Header.css";
import Navigation from "../Navigation/Navigation";
import HeaderButton from "../HeaderButton/HeaderButton";

function Header() {
  return (
    <header className="header">
      <span className="header__logo">NewsExplorer</span>
      <Navigation />
    </header>
  );
}

export default Header;
